      async getCarTrace(id, bool) {

        console.log("...... id, bool=", id, bool);

        let today = new Date();
        today.setDate(today.getDate() - 1);
        let yesterday = new Date(today);
        let todayTxt = today.getFullYear() + '-' + (today.getMonth() + 1) + '-' + today.getDate() + 'T00:00:00.000';
        let yesterdayTxt = yesterday.getFullYear() + '-' + (yesterday.getMonth() + 1) + '-' + yesterday.getDate() + 'T00:00:00.000';
